ZHT NAGA X4无人机参数：最大轴距：815mm(对称轴距)； 
尺寸:960mm*960mm*455mm(机臂展开、叶片展开、脚架展开) 440mm*210mm*200mm(臂折叠、叶片拆卸、脚托拆卸)； 
重量:≈2.5kg空机(不含电池) ; 丨≈5.3 kg空机(含电池) ; 丨 最大载荷:≈3kg; 丨最大起飞重量:≤8kg ;

